    const atab = function(base64String) {
        const bs = window.atob(base64String);
        const len = bs.length;
        const bytes = new Uint8Array(len);
        for (let i = 0; i < len; i++) {
            bytes[i] = bs.charCodeAt(i);
        }

        return bytes.buffer;
    }

    const viewer = new XMindEmbedViewer({
        el: container,
        file: atab(contents),
        styles: {
            'height': '100%',
            'width': '100%'
        }
    });
    window.viewer = viewer;
